// Components Imports
import HomePage from './Pages/HomePage'
import NavBar from './components/NavBar';
import Projects from './components/Projects';
// import AboutMePage from './Pages/AboutMePage';
// Images
// First project images and link
// import CNNup from '../src/assets/CNN-UpRight.png';
// import CNNlaying from '../src/assets/CNN-LayDown.png';
// import CNNpdf from '../src/Documents/CNN_Proposal.pdf';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


function App() {
const firstProjectTags = ["React.js", "HTML", "CSS", "JavaScript"];
    return (
        <Router>
        <div className="App">
          <NavBar />
          <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/about" component={About} />
            <Route path="/shop" component={Shop} />
          </Switch>
        </div>
        </Router>

    );
    }

export default App;
